import React from 'react';
import { connect } from 'react-redux';
//import PropTypes from "prop-types";

const InvoiceContainer = props => {
	const {
		invoice_id,
		currency,
		issue_date,
		customer_address,
		payment_method,
		items
	} = props.data;

	const onChange = async e => {
		props.onChange(e);
	};

	const onSubmit = async e => {
		e.preventDefault();
	};

	const InvoicePrototype = () => {
		if (props.loaded) {
			return (
				<form className='proto-form' onSubmit={e => onSubmit(e)}>
					<input
						type='text'
						className='proto-input'
						name='invoice_id'
						value={invoice_id}
						onChange={e => onChange(e)}
					/>
					<input type='submit' className='btn btn-primary' value='LogIn' />
				</form>
			);
		}
	};

	return <div className='invoice-prototype'>{InvoicePrototype()}</div>;
};
InvoiceContainer.prototype = {};

//const mapStateToProps = state => ({});

export default connect()(InvoiceContainer);
